import React from 'react';
import { connect } from 'react-redux';
import { createStructuredSelector } from 'reselect';

import CollectionPreview from '../../components/preview-collection/preview-collection.jsx';

import { selectShopCollection } from '../../redux/shop/shop.selectors.js';

import './shop.scss'

const ShopPage = ({collection}) => (
  <div className='shop-page'>
    {collection.map( ({id, ...other}) => (<CollectionPreview key ={id} {...other}/>))}
  </div>
);

const mapStateToProps = createStructuredSelector({
  collection: selectShopCollection
});

export default connect(mapStateToProps)(ShopPage);
